               aura_env.num = aura_env.num+1\
               if aura_env.num >= 3 then aura_env.num = 1 end\
               print(aura_env.num)\
               if aura_env.num == aura_env.mygroup then   \
                   local duration = 10             \
                   local state = {\
                       progressType = \"timed\",\
                       duration = duration,\
                       expirationTime = duration+GetTime(),\
                       autoHide = true,\
                       num = aura_env.me,\
