               for i, v in ipairs(aura_env.currentList) do\
                   if v.key == key or v.key == key2 then          \
                       if UnitIsUnit(\"player\", u) then                    \
                           WeakAuras.ScanEvents(\"NS_FORGEWEAVER_YOURCC_HIDE\", true)\
