   aura_env.MRT = function()\
       aura_env.list = {}\
       aura_env.groups = {}\
       aura_env.pos = {}\
       aura_env.backups = {}\
       aura_env.mark = {}\
       aura_env.mebackup = false\
       aura_env.mygroup = 0\
       aura_env.myspot = 0\
       aura_env.found = false\
       aura_env.dispeltimes = {\
           [1] = 60,   \
           [2] = 96,   \
           [3] = 150,   \
           [4] = 190,   \
           [5] = 224,   \
           [6] = 280,   \
           [7] = 320,   \
           [8] = 355,   \
           [9] = 405,\
       }\
       local text = NSAPI:GetNote()\
       local list = false\
       local list2 = false\
       for line in text:gmatch('[^\\r\\n]+') do\
           --check for start/end of the name list\
           if strlower(line) == \"nsdispelstart\" then\
               aura_env.found = true\
               list = true\
               aura_env.count = 0\
           elseif strlower(line) == \"nsdispelend\" then\
               list = false\
           elseif strlower(line) == \"nsdispeltimestart\" then\
               aura_env.dispeltimes = {}\
               list2 = true\
           elseif strlower(line) == \"nsdispeltimeend\" then\
               list2 = false\
           end\
           if list then \
               aura_env.list[aura_env.count] = aura_env.list[aura_env.count] or {}\
               local mark = \"\"\
               for word in line:gmatch(\"([^{]+)}\") do\
                   mark = word\
               end\
               local marknum = aura_env.marklist[mark] or 0\
               aura_env.mark[aura_env.count] = marknum            \
               line = line:gsub(\"{.-}\", \"\") -- cleaning markers from line\
               local backup = false\
               for name in line:gmatch(\"%S+\") do -- finding all remaining strings\
                   if name == \"backups\" then\
                       backup = true\
                   end\
                   if UnitInRaid(name) then\
                       name = \"raid\"..UnitInRaid(name)\
                       if backup then\
                           table.insert(aura_env.backups, name)\
                           if UnitIsUnit(\"player\", name) then\
                               aura_env.mebackup = true\
                           end\
                       else\
                           table.insert(aura_env.list[aura_env.count], name)\
                           if UnitIsUnit(name, \"player\") then\
                               aura_env.mygroup = aura_env.count\
                               aura_env.myspot = #aura_env.list[aura_env.count]\
                           end\
                           aura_env.groups[name] = aura_env.count\
                           aura_env.pos[name] = #aura_env.list[aura_env.count]\
                       end\
                   end\
               end\
               aura_env.count = aura_env.count+1\
           elseif list2 then\
               for i in line:gmatch(\"%d+\") do\
                   table.insert(aura_env.dispeltimes, i)\
               end\
           end\
       end\
   end\
   \
   aura_env.MRT()\
   DebugPrint(aura_env.dispeltimes)\
   DebugPrint(aura_env.list)",
         ["customOnUnload"] = "if aura_env.timers and aura_env.texttimers then\
       for i=1, #aura_env.dispeltimes do\
           if aura_env.timers[i] then\
               aura_env.timers[i]:Cancel()\
           end\
           if aura_env.texttimers[i] then\
               aura_env.texttimers[i]:Cancel()\
           end\
       end\
   end",
