   }",
          ["event"] = "Health",
          ["unit"] = "player",
          ["subeventSuffix"] = "_CAST_START",
          ["subeventPrefix"] = "SPELL",
          ["custom"] = "function(s, e, ...)     \
       \
       if e == \"OPTIONS\" then\
           s[\"\"] = {\
               show = true,\
               unit = \"player\",\
               index = 1,\
               progressType = \"static\",\
               changed = true\
               \
           }\
           return true\
           \
       elseif e == \"NSAPI_ENCOUNTER_START\" then\
           aura_env.dispels = {}\
           aura_env.assigned = {}\
           aura_env.specs = NSAPI:GetSpecs()\
           aura_env.backupholding = false\
           aura_env.MRT()\
           if aura_env.found then\
               aura_env.timers = {}\
               aura_env.texttimers = {}\
               local aura_env = aura_env            \
               for i=1, #aura_env.dispeltimes do     \
                   aura_env.timers[i] = C_Timer.NewTimer(aura_env.dispeltimes[i]-1, function()\
                           WeakAuras.ScanEvents(\"NS_DISPEL_GLOW\", aura_env.id)    \
                   end)\
                   aura_env.texttimers[i] = C_Timer.NewTimer(aura_env.dispeltimes[i]-1-aura_env.alerttime, function()\
                           WeakAuras.ScanEvents(\"NS_DISPEL_EVENT\", aura_env.id)    \
                   end)\
               end\
           end\
       elseif aura_env.found and not NSAPI.disable then     \
           if e == \"NS_ASSIGN_EVENT\" then        \
               local id, unit, G, glow = ...\
               if id == aura_env.id then\
                   local now = GetTime()                   \
                   local state = {\
                       progressType = \"timed\",\
                       duration = 600,\
                       expirationTime = 600+now,\
                       glow = false,\
                       ignorepos = true,\
                       assigned = true,\
                       unit = unit,\
                       autoHide = true,\
                   }\
                   s:Update(G, state)\
               end  \
           elseif e == \"NS_BACKUP_GLOW\" then        \
               local id, unit, G, glow = ...\
               if id == aura_env.id and UnitGroupRolesAssigned(\"player\") == \"HEALER\" and aura_env.mygroup == 0 then -- assign all non-assigned healers to a backup holder                \
                   local now = GetTime()                   \
                   local state = {\
                       progressType = \"timed\",\
                       duration = 600,\
                       expirationTime = 600+now,\
                       glow = false,\
                       ignorepos = true,\
                       assigned = true,\
                       unit = unit,\
                       autoHide = true,\
                   }\
                   s:Update(G, state)\
               end        \
           elseif e == \"NS_DISPEL_GLOW\" and ... and ... == aura_env.id then\
               for k, v in pairs(s) do\
                   if v.assigned then\
                       v.glow = true\
                       v.changed = true\
                   end\
               end\
               return true   \
           elseif e == \"NS_DISPEL_BACKUP\" then\
               local unit, group = ...\
               if aura_env.mebackup then\
                   local expires = select(6, WA_GetUnitAura(\"player\", aura_env.debuff, aura_env.filter))\
                   if (not expires) or (expires+2 < GetTime()+aura_env.alerttime) then\
                       aura_env.backupmarker = \"{rt\"..aura_env.mark[aura_env.groups[unit]]..\"}\"\
                       local state = {\
                           progressType = \"timed\",\
                           duration = aura_env.alerttime,\
                           expirationTime = aura_env.alerttime+GetTime(),\
                           next = \"\",\
                           prev = NSAPI:Shorten(unit, 8, true, \"WA\", true),\
                           marker = aura_env.backupmarker,\
                           holding = false,\
                           backup = false,\
                           backupassigned = true,\
                           autoHide = true,\
                       }\
                       s:Update(group, state) \
                   end\
               end\
               if aura_env.mygroup == group then\
                   aura_env.backupholding = true\
               end\
               \
           elseif e == \"NS_DISPEL_EVENT\" and ... and ... == aura_env.id then\
               if WA_GetUnitAura(\"player\", aura_env.debuff, aura_env.filter) then -- find next person if player has debuff\
                   local next = aura_env.list[aura_env.mygroup][aura_env.myspot+1] or aura_env.list[aura_env.mygroup][1] or false\
                   local backup = false\
                   if (not next) and aura_env.backupmarker then                    \
                       local state = {\
                           progressType = \"timed\",\
                           duration = aura_env.alerttime,\
                           expirationTime = aura_env.alerttime+GetTime(),\
                           next = \"\",\
                           prev = \"\",\
                           marker = aura_env.backupmarker,\
                           backupassigned = false,\
                           holding = true,\
                           backupassigned = true,\
                           backup = backup,\
                           autoHide = true,\
                       }\
                       s:Update(\"\", state)    \
                       aura_env.backupmarker = false\
                   elseif next then\
                       local expires = select(6, WA_GetUnitAura(next, aura_env.debuff, aura_env.filter))\
                       if (expires and expires+2 > GetTime()+aura_env.alerttime) or NSAPI:DeathCheck(next) then\
                           next = \"Backup\"\
                           backup = true\
                           NSAPI:Broadcast(\"NS_DISPEL_BACKUP\", \"RAID\", aura_env.mygroup) -- skip target if Raid\
                       end\
                       local state = {\
                           progressType = \"timed\",\
                           duration = aura_env.alerttime,\
                           expirationTime = aura_env.alerttime+GetTime(),\
                           next = NSAPI:Shorten(next, 8, true, \"WA\", true),\
                           prev = \"\",\
                           marker = \"{rt\"..aura_env.mark[aura_env.mygroup]..\"}\",\
                           backupassigned = false,\
                           holding = true,\
                           backup = backup,\
                           autoHide = true,\
                       }\
                       s:Update(\"\", state)    \
                   end\
               else -- check if player is meant to receive the debuff\
                   local backup = aura_env.backupholding\
                   local prev = aura_env.list[aura_env.mygroup][aura_env.myspot-1] or aura_env.list[aura_env.mygroup][#aura_env.list[aura_env.mygroup]]\
                   local expires = select(6, WA_GetUnitAura(\"player\", aura_env.debuff, aura_env.filter))\
                   if (backup or (prev and WA_GetUnitAura(prev, aura_env.debuff, aura_env.filter))) and ((not expires) or (expires+2 < GetTime()+aura_env.alerttime)) then   \
                       local state = {\
                           progressType = \"timed\",\
                           duration = aura_env.alerttime,\
                           expirationTime = aura_env.alerttime+GetTime(),\
                           next = \"\",\
                           prev = NSAPI:Shorten(prev, 8, true, \"WA\", true),\
                           marker = \"{rt\"..aura_env.mark[aura_env.mygroup]..\"}\",\
                           backupassigned = false,\
                           holding = false,\
                           backup = backup,\
                           autoHide = true,\
                       }\
                       s:Update(\"\", state)   \
                   end\
               end\
               aura_env.backupholding = false            \
               \
           elseif e == \"NS_PAMACRO\" and ... then\
               local unit = ...\
               local G = UnitGUID(unit)\
               if WA_GetUnitAura(unit, aura_env.debuff, aura_env.filter) then\
                   if UnitIsUnit(\"player\", unit) then\
                       WeakAuras.ScanEvents(\"NSAPI_MACRO_PRESSED\", true)\
                   end\
                   if s[G] then\
                       s[G].glow = true\
                       s[G].changed = true\
                       return true \
                   end\
               end    \
           elseif e == \"COMBAT_LOG_EVENT_UNFILTERED\" then\
               local timestamp, subevent, hideCaster, sourceGUID, sourceName, sourceFlags, sourceRaidFlags, destGUID, destName, destFlags, destRaidFlags, spellID,_ ,_ , extraSpellID = ... -- full CLEU\
               if spellID == aura_env.debuff then\
                   if subevent == \"SPELL_AURA_APPLIED\" then\
                       local i = UnitInRaid(destName)\
                       local unit = i and \"raid\"..i          \
                       if UnitIsUnit(\"player\", destName) then\
                           for k, v in pairs(s) do\
                               if not v.assigned then\
                                   v.show = false\
                                   v.changed = true\
                               end\
                           end\
                       end     \
                       if unit and UnitExists(unit)then \
                           if not aura_env.groups[unit] then\
                               WeakAuras.ScanEvents(\"NS_BACKUP_GLOW\", aura_env.id, unit, destGUID, false)                            \
                           end\
                           if UnitGroupRolesAssigned(\"player\") == \"HEALER\" and aura_env.groups[unit] == aura_env.mygroup then\
                               WeakAuras.ScanEvents(\"NS_ASSIGN_EVENT\", aura_env.id, unit, destGUID, false)\
                           end\
                       end\
                       return true\
                   elseif subevent == \"SPELL_AURA_REMOVED\" and s[destGUID] then \
                       if aura_env.assigned[s[destGUID].healer] then\
                           aura_env.assigned[s[destGUID].healer] = false\
                       end          \
                       s[destGUID].show = false\
                       s[destGUID].changed = true          \
                       if UnitIsUnit(\"player\", destName) then\
                           for k, v in pairs(s) do\
                               if not v.assigned then\
                                   v.show = false\
                                   v.changed = true\
                               end\
                           end\
                       end\
                       return true\
                   end\
               end\
           end\
       end     \
   end     \
   \
   \
   \
   \
   ",
