       sound = \"bool\",\
   }",
          ["duration"] = "8",
          ["event"] = "Health",
          ["unit"] = "player",
          ["subeventSuffix"] = "_CAST_START",
          ["custom"] = "function(s, e, ...)\
       if e == \"OPTIONS\" then\
           local direction = math.random(1, 2)\
           local duration = 4\
           s[\"\"] = {\
               show = true,\
               changed = true,\
               progressType = \"timed\",\
               direction = direction == 1 and \"LEFT\" or \"RIGHT\",\
               duration = duration,\
               expirationTime = duration+GetTime(),\
               autoHide = true,\
           }\
           return true\
           \
       elseif e == \"NS_WALL_DIRECTION\" then\
           local direction, mythic, markers, diff, duration = ...\
           local duration = mythic and 3 or duration or 6\
           if diff > 0 and not markers then\
               s[\"\"] = {\
                   show = true,\
                   changed = true,\
                   progressType = \"timed\",\
                   sound = (not mythic) and (not markers),\
                   direction = direction == 1 and \"LEFT\" or \"RIGHT\",\
                   duration = duration,\
                   expirationTime = duration+GetTime(),\
                   autoHide = true,\
               }\
               return true\
           end\
           \
       end\
   end\
