          ["subeventPrefix"] = "SPELL",
          ["custom"] = "function(s, e, ...)\
       if e == \"OPTIONS\" then\
           local me = math.random(1, 4)\
           local spells = {\
               [1] = {spellID = 357214, unit = \"player\"},\
               [2] = {spellID = 116844, unit = \"player\"},\
               [3] = {spellID = 132469, unit = \"player\"},\
               [4] = {spellID = 119381, unit = \"player\"},            \
           }\
           local expires = GetTime()+20\
           for i, v in ipairs(spells) do\
               local spellTable = C_Spell.GetSpellInfo(v.spellID)\
               local id = spellTable and spellTable.iconID\
               local state = {\
                   progressType = \"timed\",\
                   duration = expires-GetTime(),\
                   unit = v.unit,\
                   me = i == me,\
                   pos = i,\
                   index = i,\
                   next = i == 1,              \
                   icon = id,\
                   expirationTime = expires,\
                   autoHide = true,\
               }\
               s:Update(v.unit..v.spellID, state) \
           end       \
           \
       elseif e == \"NS_DIMENSIUS_CCTABLE\" and ... then\
           local spells, expires = ...\
           for i, v in ipairs(spells) do\
               local spellTable = C_Spell.GetSpellInfo(v.spellID)\
               local id = spellTable and spellTable.iconID\
               local state = {\
                   progressType = \"timed\",\
                   duration = expires-GetTime(),\
                   unit = v.unit,\
                   me = UnitIsUnit(\"player\", v.unit),\
                   spellID = v.spellID,\
                   pos = i,\
                   index = i,\
                   next = i == 1,       \
                   icon = id,\
                   expirationTime = expires,\
                   autoHide = true,\
               }\
               if state.me and state.next then\
                   WeakAuras.ScanEvents(\"NS_DIMENSIUS_YOURCC\", v.spellID, expires)                \
               end\
               s:Update(v.unit..v.spellID, state) \
           end     \
       elseif e == \"NS_DIMENSIUS_CCTABLE_USED\" and ... then\
           local key = ...\
           if s[key] then\
               local lowest = 10\
               local index = \"\"\
               s[key].show = false\
               s[key].changed = true\
               for k, v in pairs(s) do\
                   if k ~= key and v.pos <= lowest then\
                       lowest = v.pos\
                       index = k\
                   end\
               end\
               if lowest ~= 10 and index ~= \"\" then\
                   s[index].next = true\
                   s[index].changed = true\
                   if s[index].me then\
                       WeakAuras.ScanEvents(\"NS_DIMENSIUS_YOURCC\", s[index].spellID, s[index].expirationTime)    \
                   end            \
               end\
               return true               \
           end\
           \
       elseif e == \"NS_DIMENSIUS_CCTABLE_HIDE\" and ... then\
           s:RemoveAll() \
       end\
   end\
   \
